INSERT INTO `sae_sms_text` (`text_id`, `text`) VALUES
(1, '耶3:17 那时，人必称耶路撒冷为耶和华的宝座。万国必到耶路撒冷，在耶和华立名的地方聚集。他们必不再随从自己顽梗的恶心行事。'),
(2, '箴言4：23“你要保守你心，胜过保守一切。'),
(3, '我的神必照祂荣耀的丰富，在基督耶稣里，使你们一切所需用的都充足。当感到缺乏和不足之时，让我们想念神的丰富和恩慈，祂必然供应.'),
(4, '我的神必照祂荣耀的丰富，在基督耶稣里，使你们一切所需用的都充足。当感到缺乏和不足之时，让我们想念神的丰富和恩慈，祂必然供应.'),
(5, '耶稣又对门徒说：所以我告诉你们，不要为生命忧虑吃什么，为身体忧虑穿什么；因为生命胜于饮食，身体胜于衣裳@安稳在主怀中@'),
(6, '耶稣又对门徒说：所以我告诉你们，不要为生命忧虑吃什么，为身体忧虑穿什么；因为生命胜于饮食，身体胜于衣裳@安稳在主怀中@'),
(7, '弟兄们，这样看来，我们并不是欠肉体的债，去顺从肉体活着。你们若顺从肉体活着，必要死；若靠着圣灵治死身体的恶行，必要活着。'),
(8, '因为祂的怒气不过是转眼之间，祂的恩典乃是一生之久。一宿虽然有哭泣，早晨便必欢呼。纵然暂时落在困难中，神恩典仍是我们所倚靠的。'),
(9, '因为祂的怒气不过是转眼之间，祂的恩典乃是一生之久。一宿虽然有哭泣，早晨便必欢呼。纵然暂时落在困难中，神恩典仍是我们所倚靠的。'),
(10, '因为祂的怒气不过是转眼之间，祂的恩典乃是一生之久。一宿虽然有哭泣，早晨便必欢呼。纵然暂时落在困难中，神恩典仍是我们所倚靠的。'),
(11, '神的道是活泼的，是有功效的，比一切两刃的剑更快，甚至魂与灵，骨节与骨髓，都能刺入、剖开，连心中的思念和主意都能辨明。信守主道。'),
(12, '神非人，必不致说谎，也非人子，必不致后悔。他说话岂不照着行呢？他发言岂不要成就呢？当心中起了疑虑，默想神的本性就能重拾信心。'),
(13, '耶和华万军之神啊，求你使我们回转，使你的脸发光，我们便要得救！若你落在叛逆神的光景中，愿你及时回转，神必接纳、拯救和引导。'),
(14, '我必将他种在这地。素不蒙怜悯的，我必怜悯；本非我民的，我必对他说：你是我的民。他必说：你是我的神。父神对沉溺罪恶的人深情应许。'),
(15, '神人说：不要惧怕！与我们同在的比与他们同在的更多。神应许与我们同在，我们用信心的眼睛，必能看见神大能的怀抱、保护及引导。'),
(16, '他们经过流泪谷，叫这谷变为泉源之地，并有秋雨之福盖满了全谷。他们行走，力上加力，各人到锡安朝见神。对忧伤的人是何等的安慰'),
(17, '神说：我使你的肩得脱重担，你的手放下筐子。你在急难中呼求，我就搭救你；神与我们的距离就只有一个祷告那么近，随时求告他。'),
(18, '我要听神耶和华所说的话，因为他必应许将平安赐给他的百姓他的圣民；他们却不可再转去妄行。领受神宝贵应许的先决条件是听从神的吩咐!'),
(19, '神非人，必不致说谎，也非人子，必不致后悔。他说话岂不照着行呢？他发言岂不要成就呢？这两个反问让我们更有信心支取神宝贵的应许.'),
(20, '神说：因为他专心爱我，我就要搭救他；因为他知道我的名，我要把他安置在高处。主应许拯救和保护认识他、爱他的人。'),
(21, '耶和华是应当称颂的！因为他照着一切所应许的赐平安给他的民以色列人，凡藉他仆人摩西应许赐福的话，一句都没有落空。@父神信守应许@'),
(22, '并且仰望​​神的应许，总没有因不信心里起疑惑，反倒因信心里得坚固，将荣耀归给神。亚伯拉罕在没有盼望的处境下仍然深信神必成就应许。'),
(23, '林前7:32 我愿你们无所挂虑。没有娶妻的，是为主的事挂虑，想怎样叫主喜悦。33 娶了妻的，是为世上的事挂虑，想怎样叫妻子喜悦'),
(24, '林前8:1 论到祭偶像之物，我们晓得我们都有知识。但知识是叫人自高自大，惟有爱心能造就人。'),
(25, '所以你要知道耶和华你的神，他是神，是信实的神，向爱他、守他诫命的人守约施慈爱，直到千代。知道神是信实的，更要以顺服的心来爱他。'),
(26, '林前7:16 你这作妻子的，怎么知道不能救你的丈夫呢？你这作丈夫的，怎么知道不能救你的妻子呢？'),
(27, '你摆设筵席，倒要请那贫穷的、残废的、瘸腿的、瞎眼的，你就有福了！因为他们没有什么可报答你。到义人复活的时候你要得着报答。'),
(28, '林前13:8 爱是永不止息；先知讲道之能终必归于无有；说方言之能终必停止；知识也终必归于无有。'),
(29, '他们必求告我的名，我必应允他们。我要说：这是我的子民。他们也要说：耶和华是我们的神。神借苦难熬炼信徒，驱促我们来与他和好。'),
(30, '诗72:5 太阳还存，月亮还在，人要敬畏你，直到万代。'),
(31, '诗78:4 我们不将这些事向他们的子孙隐瞒。要将耶和华的美德和他的能力，并他奇妙的作为，述说给后代听。温馨提醒：明天主日学会议'),
(32, '诗80:7 万军之　神啊！求你使我们回转。'),
(33, '彼后1:7 有了虔敬，又要加上爱弟兄的心；有了爱弟兄的心，又要加上爱众人的心。'),
(34, '当日摩西起誓说：你脚所踏之地定要归你和你的子孙永远为业，因为你专心跟从耶和华我的神。信徒也可以因专一跟从神而得着属天永恒基业。'),
(35, '因为你曾以力量束我的腰，使我能争战；你也使那起来攻击我的都服在我以下。每天面对属灵争战，谨记神赐力量的应许，靠他过得胜生活。'),
(36, '我必从你中间除灭雕刻的偶像和柱像，你就不再跪拜自己手所造的。人的信心脆弱，依赖自己所建立的，神却应许除掉偶像，让人专一信靠祂。'),
(37, '诗91:14 神说，因为他专心爱我，我就要搭救他。因为他知道我的名，我要把他安置在高处。15 他若求告我，我就应允他。'),
(38, '默想我是藐视神吗？经文：儿子尊敬父亲，仆人敬畏主人。我既为父亲，尊敬我的在哪里呢？我既为主人，敬畏我的在哪里呢？参阅玛拉基书1章'),
(39, '在你城里无分无业的利未人，和你城里寄居的并孤儿寡妇，都可以来，吃得饱足。这样，耶和华你的神必在你手里所办的一切事上赐福与你。'),
(40, '太7:11 你们虽然不好，尚且知道拿好东西给儿女，何况你们在天上的父，岂不更把好东西给#求#他的人吗？'),
(41, '因为主的眼看顾义人，主的耳听他们的祈祷；惟有行恶的人，主向他们变脸。你们若是热心行善，有谁害你们呢?靠主应许热心行善。'),
(42, '你发一个能接的号码到我的手机上吧，我打电话比较便宜 -郭'),
(43, '你心若向饥饿的人发怜悯，使困苦的人得满足，你的光就必在黑暗中发现，你的幽暗必变如正午。关怀别人，做世上的光，照亮幽暗角落。'),
(44, '诗119:15我要默想你的训词，看重你的道路。18求你开我的眼睛，使我看出你律法中的奇妙。27求你使我明白你的训词，我就...'),
(45, '诗124:8 我们得帮助，是在乎倚靠造天地之耶和华的名。'),
(46, '因为主必不永远丢弃人。主虽使人忧愁，还要照他诸般的慈爱发怜悯。因他并不甘心使人受苦，使人忧愁。主永不丢弃，纵有忧愁只是暂时。'),
(47, '诗134:1耶和华的仆人，夜间站在耶和华殿中的，你们当称颂耶和华'),
(48, '耶和华是我的岩石，我的山寨，我的救主，我的神，我的盘石，我所投靠的。他是我的盾牌，是拯救我的角，是我的高台。主是大能保护者。'),
(49, '诗136:1 你们要称谢耶和华，因他本为善。他的慈爱永远长存。'),
(50, '耶和华对基甸说：跟随你的人过多，我不能将米甸人交在他们手中，免得以色列人向我夸大，说：是我们自己的手救了我们。专一靠主不靠自己'),
(51, '诗147:10 他不喜悦马的力大，不喜爱人的腿快。11 耶和华喜爱敬畏他和盼望他慈爱的人'),
(52, '箴6:20 我儿，要谨守你父亲的诫命，不可离弃你母亲的法则。要常系在你心上，挂在你项上，你行走，他必引导你。你躺卧，他必保守你。'),
(53, '必有许多国的民前往，说：来吧！我们登耶和华的山，奔雅各神的殿；主必将他的道教训我们，我们也要行他的路。主应许以他的真道引领'),
(54, '必有许多国的民前往，说：来吧！我们登耶和华的山，奔雅各神的殿；主必将他的道教训我们，我们也要行他的路。主应许以他的真道引领'),
(55, '箴14:27 敬畏耶和华，就是生命的泉源，可以使人离开死亡的网罗。'),
(56, '箴16:9 人心筹算自己的道路。惟耶和华指引他的脚步。'),
(57, '圣灵向众教会所说的话，凡有耳的就应当听。得胜的，必不受第二次死的害。复活的主应许士每拿教会，摆上自己维护真道的必得生命的冠冕。'),
(58, '撒上2:25 人若得罪人，有士师审判他。人若得罪耶和华，谁能为他祈求呢？'),
(59, '林前13:3 我若将所有的周济穷人，又舍己身叫人焚烧，却没有爱，仍然与我无益。'),
(60, '赛11:1 从耶西的本（原文作橔）必发一条，从他根生的枝子必结果实。''不''也作橔 念dun 即木墩'),
(61, '约6:35 耶稣说，我就是生命的粮。到我这里来的，必定不饿。信我的，永远不渴。'),
(62, '约6:35 耶稣说，我就是生命的粮。到我这里来的，必定不饿。信我的，永远不渴。');
